import React, { useState, useEffect } from 'react';
import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';
import './Products.css';

const Products = () => {
  const [selectedCategory, setSelectedCategory] = useState('Todos');
  const [currentSlide, setCurrentSlide] = useState(0);
  const [priceRange, setPriceRange] = useState([0, 1000000]);

  const products = [
    { id: 1, category: 'Ropa', name: 'Buzo Azul', price: 35000, image: 'https://th.bing.com/th/id/OIP._e6RKSC1t79wgvAjhJeLvgAAAA?rs=1&pid=ImgDetMain' },
    { id: 2, category: 'Animales', name: 'Perrito', price: 0, image: 'https://th.bing.com/th/id/OIP.k6XwmsZC74RsZpgSu4U8vAHaIx?rs=1&pid=ImgDetMain' },
    { id: 3, category: 'Electrodomesticos', name: 'Licuadora', price: 355000, image: 'https://th.bing.com/th/id/R.13f85b1e425c793cfe5688e27de879cb?rik=0Uw9A9O9deYTJg&riu=http%3a%2f%2fsalpimenta.com.ar%2fwp-content%2fuploads%2f2014%2f12%2fLicuadora-Color-Oster-alta-2.jpg&ehk=BKPxg93u65Lv72OxSp7XZPhwcJfUszP2QW46PCwDzH8%3d&risl=&pid=ImgRaw&r=0' },
    { id: 4, category: 'Celulares', name: 'Iphone X', price: 832000, image: 'https://i.blogs.es/b1cb6d/iphone_x/1366_2000.png' },
  ];

  const carouselImages = [
    '/assets/images/Donaton.jpeg',
    '/assets/images/donaton.jpg',
    '/assets/images/donatt.jpg'
  ];

  const handlePriceChange = (value) => {
    setPriceRange(value);
  };

  const filteredProducts = products.filter((product) => {
    const matchCategory = selectedCategory === 'Todos' || product.category === selectedCategory;
    const matchPrice = product.price >= priceRange[0] && product.price <= priceRange[1];
    return matchCategory && matchPrice;
  });

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prev) => (prev + 1) % carouselImages.length);
    }, 3000);
    return () => clearInterval(interval);
  }, [carouselImages.length]);

  return (
    <div className="products-page">
      <aside className="filters">
        <h3>CategorÃ­as</h3>
        <ul>
          {['Todos',
          'Juguetes',
          'Electrodomesticos',
          'Ropa',
          'Sacos de comida',
          'Animales',
          'Jaulas',
          'Celulares',
          'Platos',
          'Peceras'
          ,'Colchones'].map((cat) => (
            <li key={cat} onClick={() => setSelectedCategory(cat)}>{cat}</li>
          ))}
        </ul>

        <h3>Precio</h3>
        <div style={{ margin: '20px 10px' }}>
          <Slider
            range
            min={0}
            max={1000000}
            step={10000}
            defaultValue={priceRange}
            onChange={handlePriceChange}
            trackStyle={[{ backgroundColor: '#333' }]}
            handleStyle={[{ borderColor: '#333' }, { borderColor: '#333' }]}
          />
          <p style={{ marginTop: '10px' }}>
            ${priceRange[0].toLocaleString()} - ${priceRange[1].toLocaleString()}
          </p>
        </div>
      </aside>

      <main className="product-list">
        <div className="search-bar">
          <input type="text" placeholder="Buscar..." />
        </div>

        <div className="carousel">
          <img src={carouselImages[currentSlide]} alt="Publicidad" />
        </div>

        <div className="products-grid">
          {filteredProducts.map((product) => (
            <div className="product-card" key={product.id}>
              <img src={product.image} alt={product.name} />
              <span className="tag">{product.price === 0 ? 'DonaciÃ³n' : 'Venta'}</span>
              <h4>{product.name}</h4>
              <p>{product.price === 0 ? 'GRATIS' : `$${product.price.toLocaleString()}`}</p>
            </div>
          ))}
        </div>

        <div className="pagination">
          <button>Anterior</button>
          <span>1</span>
          <button>Siguiente</button>
        </div>
      </main>
    </div>
  );
};

export default Products;
